import { useEffect, useState,} from "react";

import { retrieveAFlightById, retrieveAllFlights } from "../api/CallingApi";
// import { useNavigate } from "react-router-dom";
// import { useAuth } from "./security/AuthContext";

function FlightList(){ 

        // const authContext= useAuth()

        const [flights,setFlights] = useState([])

        const [message,setMessage] = useState(null)

        const[searchId,setsearchId] = useState(" ")

        // const nevigate=useNavigate();

        useEffect(() => {
           flightList();
     }, []);

        function flightList(){

                retrieveAllFlights()
                .then( (response) =>
                    {
                        // console.log(response.data)
                        setFlights(response.data)
                    } 
                )
                .catch( error =>console.log(error))
           
        }

        //ById
        // Search by ID function
    function searchById() {
        if (!searchId.trim()) {
            setMessage("Please enter a flight ID");
            return;
        }
        retrieveAFlightById(searchId)
            .then((response) => {
                if (response.data) {
                    setFlights([response.data]); // Wrap in array for consistent mapping
                    setMessage(null);
                } else {
                    setFlights([]);
                    setMessage("No flight found with that ID");
                }
            })
            .catch(error => {
                console.error(error);
                setMessage("Error searching for flight");
                setFlights([]);
            })
    }

        // function searchBar(username){

        //     // console.log('Search here ' + username)

        //     retrieveAStudent(username)
        //     .then( (response) =>
        //         {
        //             // console.log(response)
        //             setTodos(response.data)
        //         } 
        //         )
        //     .catch( error =>console.log(error))
        // }

        function HandleSearch(event){
                setsearchId(event.target.value)
            }

        // function deleteStudent(id){
        //     //  console.log('delete operation' + id);

        //     DeleteStudentById(id)
        //     .then( 

        //         () => 
        //             {
        //             //display message
        //             setmessage(`The todo with id ${id} is deleted`)
        //             //update todolist
        //             refreshTodos()

        //         }
        //         )
        //     .catch( error =>console.log(error))
        // }

//    function UpdateTodo(id){
//     //  console.log('Update operation' + id);
     
//      nevigate(`/CreateNewStudent/${id}`)

//    }

//    function CreateNewStudent(){

//     // console.log('Create operation');
 
//     nevigate(`/CreateNewStudent/-1`)
//    }


     return (
        <div className="container">
            <h1>Flights List</h1>
            {message && <div className="alert alert-warning">{message}</div>}
            {loading && <div className="alert alert-info">Loading...</div>}

            <div className="mb-3">
                <div className="input-group">
                    <input 
                        type="search" 
                        placeholder="Search flight by ID" 
                        value={searchId}
                        onChange={handleSearchChange}
                        onKeyPress={handleKeyPress}
                        className="form-control"
                    />
                    <button 
                        onClick={searchById} 
                        className="btn btn-primary"
                        disabled={loading}
                    >
                        Search
                    </button>
                    <button 
                        onClick={flightList} 
                        className="btn btn-secondary"
                        disabled={loading}
                    >
                        Show All
                    </button>
                </div>
            </div>

            <table className='table table-striped'>
                <thead className="thead-dark">
                    <tr>
                        <th>ID</th>
                        <th>Departure From</th>
                        <th>Arrival To</th>
                        <th>Departure</th>
                        <th>Return Date</th>
                        <th>Seats Available</th>
                    </tr>
                </thead>
                <tbody>
                    {flights.length > 0 ? (
                        flights.map(flight => (
                            <tr key={flight.id}>
                                <td>{flight.id}</td>
                                <td>{flight.departureFrom || "-"}</td>
                                <td>{flight.arrivalTo || "-"}</td>
                                <td>{flight.departure || "-"}</td>
                                <td>{flight.returnDate || "-"}</td>
                                <td>{flight.seatsAvailable || "0"}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="6" className="text-center">
                                {!loading && "No flights found"}
                            </td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
}

export default FlightList
